import React from 'react';
import {
  Container,
  Typography,
  Box,
  Paper,
  Grid,
  Chip,
  Button,
  Tab,
  Tabs,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import EventIcon from '@mui/icons-material/Event';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const Bookings = () => {
  const [tabValue, setTabValue] = React.useState(0);
  const navigate = useNavigate();

  // Mock bookings data - in real app, this would come from an API
  const bookings = [
    {
      id: 1,
      carName: 'BMW 4 Series',
      date: '2023-08-15',
      time: '10:00 AM',
      location: 'BMW Showroom, Downtown',
      status: 'Upcoming',
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?auto=format&fit=crop&w=400',
    },
    {
      id: 2,
      carName: 'Mercedes AMG GT',
      date: '2023-08-20',
      time: '2:30 PM',
      location: 'Mercedes Dealership, West End',
      status: 'Confirmed',
      image: 'https://images.unsplash.com/photo-1617531653332-bd46c24f2068?auto=format&fit=crop&w=400',
    },
    {
      id: 3,
      carName: 'Audi RS7',
      date: '2023-07-30',
      time: '11:00 AM',
      location: 'Audi Center, East Side',
      status: 'Completed',
      image: 'https://images.unsplash.com/photo-1614200187524-dc4b892acf16?auto=format&fit=crop&w=400',
    },
  ];

  const getStatusColor = (status) => {
    switch (status) {
      case 'Upcoming':
        return 'primary';
      case 'Confirmed':
        return 'success';
      case 'Completed':
        return 'default';
      default:
        return 'default';
    }
  };

  const filteredBookings = bookings.filter((booking) => {
    if (tabValue === 0) return true; // All bookings
    if (tabValue === 1) return booking.status === 'Upcoming' || booking.status === 'Confirmed';
    if (tabValue === 2) return booking.status === 'Completed';
    return true;
  });

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" gutterBottom>
        My Bookings
      </Typography>

      <Box sx={{ borderBottom: 1, borderColor: 'divider', mb: 3 }}>
        <Tabs
          value={tabValue}
          onChange={(e, newValue) => setTabValue(newValue)}
          aria-label="booking tabs"
        >
          <Tab label="All Bookings" />
          <Tab label="Active Bookings" />
          <Tab label="Past Bookings" />
        </Tabs>
      </Box>

      <Grid container spacing={3}>
        {filteredBookings.map((booking) => (
          <Grid item xs={12} key={booking.id}>
            <Paper
              elevation={2}
              sx={{
                p: 3,
                borderRadius: 2,
                '&:hover': { transform: 'translateY(-2px)', transition: 'transform 0.2s' },
              }}
            >
              <Grid container spacing={3} alignItems="center">
                <Grid item xs={12} sm={3}>
                  <img
                    src={booking.image}
                    alt={booking.carName}
                    style={{
                      width: '100%',
                      height: '120px',
                      objectFit: 'cover',
                      borderRadius: '8px',
                    }}
                  />
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Typography variant="h6" gutterBottom>
                    {booking.carName}
                  </Typography>
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mb: 1 }}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <EventIcon color="action" />
                      <Typography variant="body2">{booking.date}</Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <AccessTimeIcon color="action" />
                      <Typography variant="body2">{booking.time}</Typography>
                    </Box>
                  </Box>
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <LocationOnIcon color="action" />
                    <Typography variant="body2" color="text.secondary">
                      {booking.location}
                    </Typography>
                  </Box>
                </Grid>
                <Grid item xs={12} sm={3} sx={{ textAlign: 'right' }}>
                  <Chip
                    label={booking.status}
                    color={getStatusColor(booking.status)}
                    sx={{ mb: 2 }}
                  />
                  <Box>
                    <Button
                      variant="outlined"
                      size="small"
                      onClick={() => navigate(`/car/${booking.id}`)}
                      sx={{ mr: 1 }}
                    >
                      View Car
                    </Button>
                    {(booking.status === 'Upcoming' || booking.status === 'Confirmed') && (
                      <Button
                        variant="contained"
                        size="small"
                        color="primary"
                      >
                        Reschedule
                      </Button>
                    )}
                  </Box>
                </Grid>
              </Grid>
            </Paper>
          </Grid>
        ))}
      </Grid>

      {filteredBookings.length === 0 && (
        <Box
          sx={{
            textAlign: 'center',
            py: 8,
          }}
        >
          <Typography variant="h6" color="text.secondary" gutterBottom>
            No bookings found
          </Typography>
          <Button
            variant="contained"
            onClick={() => navigate('/')}
            sx={{ mt: 2 }}
          >
            Browse Cars
          </Button>
        </Box>
      )}
    </Container>
  );
};

export default Bookings;
